// ==UserScript==
// @name         Item Type Marker
// @namespace    http://tampermonkey.net/
// @version      2024-06-14
// @description  Add "type" icons to items on moonbounce.gg
// @author       cullen
// @match        https://moonbounce.gg/u/@me/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=moonbounce.gg
// @grant        unsafeWindow
// @downloadURL https://update.greasyfork.org/scripts/497952/Item%20Type%20Marker.user.js
// @updateURL https://update.greasyfork.org/scripts/497952/Item%20Type%20Marker.meta.js
// ==/UserScript==

(async function() {
    'use strict';

    // The icons we use (go to icon url and choose "Other - PNG", then right-click the lower preview to get the image address)
    const icons = {
        // https://icon-sets.iconify.design/mdi/question-mark/
        default: 'data:image/png;base64,',
        // https://icon-sets.iconify.design/mdi/tools/
        tool: 'data:image/png;base64,',
        // https://icon-sets.iconify.design/mdi/redhat/
        accessory: 'data:image/png;base64,',
        // https://icon-sets.iconify.design/mdi/person/
        character: 'data:image/png;base64,',
        // https://icon-sets.iconify.design/mdi/package-variant-closed/
        material: 'data:image/png;base64,'
    }

    // Polyfil
    const GM_addStyle = (css) => {
        const style = document.getElementById("GM_addStyleBy8626") || (function() {
            const style = document.createElement('style');
            style.type = 'text/css';
            style.id = "GM_addStyleBy8626";
            document.head.appendChild(style);
            return style;
        })();
        const sheet = style.sheet;
        sheet.insertRule(css, (sheet.rules || sheet.cssRules || []).length);
    }

    // Main style
    GM_addStyle(`
    .itemTypeMarker {
        margin-top: -22px !important;
        margin-left: 30px !important;
        width: 20px !important;
        height: 20px !important;
        background-color: unset !important;
        line-height: 19px;
        font-size: 14px;
        //background-color: white !important;
        border: 2px solid #E6E8EC !important;
        border-radius: 11px !important;
        background-size: cover !important;
        background-color: white !important;
    }
    `)

    // Icon specific styles
    Object.entries(icons).forEach(([key, val]) => {
        GM_addStyle(`
        .itemTypeMarker-${key} {
            background: url(${val}) no-repeat center center !important;
            background-size: cover !important;
            background-color: white !important;
        }
        `)
    })

    // Store user's itemData for reference
    const itemData = await fetch('https://moonbounce.gg/u/@me/backpack?_data=routes%2Fu.%5B%40me%5D%2B%2Fbackpack%2B%2F_index')
        .then(response => response.json())
        .then(data=> data?.batched?.reduce((acc, curr) => {
            if(!acc[curr.type]) acc[curr.type] = [];
            acc[curr.type].push(curr.preview_image);
            return acc;
        },{})
    )

    // Finds an item's type from our fetched item data using an item's preview_image
    const findItemType = (url) => {
        for (const key in itemData) {
            if (itemData.hasOwnProperty(key)) {
                const categoryArray = itemData[key];
                if (categoryArray.includes(url)) {
                    return key;
                }
            }
        }
        return 'default'; // URL is not found in any items
    }

    // Adds the divs used to display item types to the items on the page
    const addTypeMarkers = () => {
        document.querySelectorAll('._inner_65041_64 img').forEach((item, i) => {
            // Don't dup
            if(item.parentElement.querySelector('.itemTypeMarker')) return;
            const itemType = findItemType(item.src);
            item.parentElement.insertAdjacentHTML('beforeend',`<div class="_rarity_box_65041_85 _rare_65041_107 itemTypeMarker itemTypeMarker-${itemType}"></div>`)
        })
    }

    // Observer junk that makes sure the item type markers are added when needed
    const targetNode = document.querySelector('div.content_area');
    const config = { attributes: true, childList: true, subtree: true };

    const callback = async function(mutationsList, observer) {
        const markedItems = document.querySelectorAll('.itemTypeMarker').length;
        const isChangingAttributes = mutationsList.find(mutation => mutation.type == 'attributes');

        if (markedItems != itemData?.length && isChangingAttributes) {
            tryToAddItemMarkers();
        }
    };

    // Gotta wait for itemData to finish fetching before we can add markers
    const tryToAddItemMarkers = async () => {
        while (true) {
            if (!(itemData instanceof Promise) && !itemData?.then) {
                addTypeMarkers();
                break;
            }
        }
    }

    const observer = new MutationObserver(callback);
    observer.observe(targetNode, config);

    // Run once on init incase the observer attached after the page finished loading
    tryToAddItemMarkers();
})();